import {data} from "../api/data";
import Note from "./Note";

const ListNotes =()=> {


    const list =
    data.map((i, index)=>(
        <Note key={index} id={i.id} title_={i.title} content={i.content}/>
    )
    );


    return(
        <>
            {
                list
            }
        </>
    );
}

export default ListNotes;
